char *ConCommandBase::CopyString(const char *from)
{
	int		len;
	char	*to;

	len = strlen(from);
	if (len <= 0)
	{
		to = new char[1];
		to[0] = 0;
	}
	else
	{
		to = new char[len + 1];
		strncpy_s(to, len + 1, from, len + 1);
	}
	return to;
}

